Hello,

i have build succesfully ONNXRuntime with TensorRT-EP from source on my Windows 10 PC. Libraries i used for building:
- TensorRT = 8.5.1.7
- CUDA = 11.6
- cuDNN = 8.5.0

Enviroment:
- Windows 10 (Build 19045)
- Visual Studio 2022 17.4.4
- Microsoft Visual C++ 2015-2022 Redistributable (x86) - 14.34.31931

Now my problem is that i can use the CUDA-EP, but not the TensorRT-EP.
As soon as i use the TensorRT-EP, i get an exception in Visual Studio 2022:
`Exception thrown at 0x00007FF80486635A (onnxruntime_providers_tensorrt.dll) in ORT_Testing_2022.exe: 0xC0000005: Access violation reading location 0xFFFFFFFFFFFFFFFF.`

Visual Studio 2022 tells me that this exception is thrown in this file "xstring" in line 415: `return __builtin_strlen(_First);`
The crash happens when i call `session_options.AppendExecutionProvider_TensorRT(options_trt);` in my code.

