### Describe the issue

Background: We use the java api of onnxruntime for model reasoning. After each update of the model, we need to reload the model and related files. So we define a method to reload the model. The way we reload the model is as follows：
```
public void reloadModel(String modelPath){
      ...
     try{
        OrtSession oldSession =session;
        env = OrtEnvironment.getEnvironment(OrtLoggingLevel.ORT_LOGGING_LEVEL_INFO, "modelService");
        options = new OrtSession.SessionOptions();
        options.addCUDA();
        session = env.createSession(modelPath, options);
        this.closeOrtSession(oldSession);
      }catch(Exception e){
       ...
      }
}

/**
     *
     * @param session
     */
private void closeOrtSession(OrtSession session){
        try{
            session.close();
        }catch (Exception e){
            log.warn("【reloadModel】Trying to close an already closed OrtSession.");
        }
    }

```
Phenomenon: Every time we call the reloadModel() method, the memory will increase. After about five or six reloads, the memory usage will increase from 2G to about 5G. We are very puzzled. Every time we reload the model, the old session will be closed, why the memory usage is still increasing, and we have observed the JVM heap memory and non-heap memory, there is no increase, which proves that these memory growth is outside the jvm, can you help us see what's the problem~

